for all $x,y\in\mathbb{R}$. If $f'(0)=\tfrac12$, then the value of $24\,f''\bigl(\tfrac{5\pi}{3}\bigr)$ is:

The term independent of $x$ in the expansion of
$\displaystyle\bigl(\tfrac{x+1}{x^{2/3}+1-x^{1/3}} - \tfrac{x+1}{x-x^{1/2}}\bigr)^{10}$,
for $x>1$, is:

